function Footer() {
    return(
        <>
            <div className="container section footer ">
                <div className="row secondarybg">

                    <div className="col">
                        <a href="#home"><img className="logo" src={logo} alt="logo"/></a>
                    </div>

                    <div className="col">
                        
                    </div>

                    <div className="col">
                    
                    </div>

                </div>
            </div>
        </>
    );
}

export default Footer;
